    'Search and add a related product' => 'Ieškoti ir pridėti susijusią prekę',
    'Use a comma to create seperate tags. E.g.: dress, cotton, party dresses.' => 'Naudokite kablelį, norėdami atskirti gaires. Pvz.: suknelė, medvilnė, kokteilinė suknelė.',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Kombinuoti skirtingus atributus, pvz.: "Dydis: visi", "Spalva: raudona".',
    'Per kilo, per litre' => 'Už kilogramą, už litrą',
    'Create a new product: CTRL+P' => 'Sukurti naują prekę: `Ctrl + P`',
    'Your internal name for this attribute.' => 'Vidinis šio atributo pavadinimas.',
