    'Choose the attribute group for this value.' => 'Pasirinkite savybių grupę šiai reikšmei.',
    'Choose a color with the color picker, or enter an HTML color (e.g. "lightblue", "#CC6600").' => 'Pasirinkite norimą spalvą naudodamiesi spalvų pasirinkimo įrankiu arba įrašykite HTML spalvos kodą (pvz.: "lightblue", "#CC6600").',
    'Upload an image file containing the color texture from your computer.' => 'Įkelti paveiksliuko failą, kuriame yra spalvos tekstūra.',
