    'This type will be used for Brand images.' => 'Šis tipas bus naudojamas prekės ženklių paveiksliukams.',
    'This type will be used for Supplier images.' => 'Šis tipas bus naudojamas tiekėjo paveiksliukams.',
    'This type will be used for Store images.' => 'Šis tipas bus naudojamas "Parduotuvės" paveiksliukams.',
    'Will appear on main page. Recommended size for the default theme: height %height% and width %width%.' => 'Bus rodoma pagrindiniame puslapyje. Rekomenduojami dydžiai numatytajai temai: aukštis %height% ir plotis %width%.',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Bus rodomas el. laiškų antraštėse. Jei nenurodytas - bus rodomas antraštės logotipas.',
    'Warning: if no invoice logo is available, the main logo will be used instead.' => 'Įspėjimas: neradus/nenurodžius sąskaitai-faktūrai skirto logotipo bus naudojamas pagrindinis logotipas.',
    'Will appear on invoice headers.' => 'Bus rodoma sąskaitų antraštėje.',
    'Warning: you can use a PNG file for transparency, but it can take up to 1 second per page for processing. Please consider using JPG instead.' => 'Įspėjimas: Jūs galite naudoti PNG failą dėl permatomumo, bet tai gali padidinti puslapio generavimo procesą papildoma sekunde. Pasvarstykite, ar verta naudoti JPEG.',
    'Will appear in the address bar of your web browser.' => 'Rodoma naršyklės adreso juostoje.',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Privalote pasirinkti parduotuvę iš aukščiau esančio sąrašo, kuriai norėsite parinkti temą.',
    'Browse your computer files and select the Zip file for your new theme.' => 'Pasirinkite naujos temos Zip failą iš savo kompiuterio.',
    'Indicate the complete URL to an online Zip file that contains your new theme. For instance, "http://example.com/files/theme.zip".' => 'Nurodykite pilną URL į įkeltą Zip failą, kuriame yra temos failai. Pvz. "http://example.com/files/theme.zip".',
    'This selector lists the Zip files that you uploaded in the \'/themes\' folder.' => 'Ši parinktis rodo sąrašą Zip failų, kuriuos įkėlėte į \'/themes\' aplanką.',
    'To add "tags" click in the field, write something, and then press "Enter."' => 'Norėdami sukurti "žymą", spustelėkite laukelyje, ką nors parašykite ir paspauskite "Enter."',
    'Regenerates thumbnails for all existing images' => 'Iš naujo sukuria miniatiūras visiems prekių vaizdams',
    'Please be patient. This can take several minutes.' => 'Būkite kantrūs - tai gali užtrukti kelias minutes',
    'Be careful! Manually uploaded thumbnails will be erased and replaced by automatically generated thumbnails.' => 'Dėmesio! Rankiniu būdu sukurtos miniatiūros bus ištrintos automatiškai sukurtų miniatiūrų.',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Pasirinkite "Ne" tik jeigu jūsų serveris sugeneravo "time out" klaidą ir jūs norite tęsti pergeneravimą.',
    'Please select a module' => 'Pasirinkite modulį',
    'Select a module above before choosing from available hooks' => 'Aukščiau pasirinkite modulį, prieš pasirinkdami galimus hukus',
    'Please specify the files for which you do not want the module to be displayed.' => 'Nurodykite failus (kontrolerius), kuriuos norite, kad šis (konfiguruojamas) modulis ignoruotų (pvz.: saraše pažymėjus `sitemap` kabinamas modulis puslapyje `/index.php?controller=sitemap` bus ignoruojamas (nenaudojamas/nerodomas)).',
    'Please input each filename, separated by a comma (",").' => 'Įveskite kiekvieną failo pavadinimą, atskirtą kableliu (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'Jūs taip pat galite paspausti ant failo pavadinimo, esančio žemiau sąraše, arba pasirinkti kelis vienu metu, laikant `Ctrl` klavišą ir spaudžiant pele, arba intervalą - spaudžiant pele, kol laikomas `Shift` klavišas.',
  ),
  'AdminDesignNotification' => 
  array (
    'Your theme has been correctly exported: %path%' => 'Jūsų tema sėkmingai eksportuota: %path%',
    'This theme is not valid for PrestaShop 1.7' => 'Ši tema nepalaiko PrestaShop 1.7',
    'An error occurred. The information "%s" is missing.' => 'Įvyko klaida. Informacija "%s" yra trūkstama.',
    'An error occurred. The template "%s" is missing.' => 'Įvyko klaida. Šablonas "%s" yra trūkstamas.',
    'An error occurred while uploading the favicon: cannot copy file "%s" to folder "%s".' => 'Įvyko klaida bandant įkelti favicon paveiksliuką: nepavyko nukopijuoti "%s" į aplanką "%s".',
    'Current theme is unavailable. Please check your theme\'s directory name ("%s") and permissions.' => 'Dabartinė tema nepasiekiama. Patikrinkite savo temos pavadinimą ("%s") ir leidimus.',
    'The page Category cannot be moved here.' => 'Kategorija negali būti perkelta čia.',
    'Duplicate images were found when moving the product images. This is likely caused by unused demonstration images. Please make sure that the folder %s only contains demonstration images, and then delete it.' => 'Rasti pasikartojantys paveiksliukai bandant perkelti prekės paveiksliukus. Tai dažniausia atsitinka dėl nenaudojamų demonstracinių paveiksliukų. Įsitikinkite, kad aplanke %s yra tik demonstracinius paveiksliukai ir tuomet jį ištrinkite.',
    'Incorrect value for the selected JPEG image compression.' => 'Pasirinkta klaidinga reikšmė JPEG nuotraukų suglaudinimui.',
    'Incorrect value for the selected PNG image compression.' => 'Pasirinkta klaidinga reikšmė PNG nuotraukų suglaudinimui.',
    'This name already exists.' => 'Vardas jau egzistuoja.',
    'Source file does not exist or is empty (%filepath%)' => 'Šaltinio failas neegzistuoja arba yra tuščias (%filepath%)',
    'Failed to resize image file (%filepath%)' => 'Nepavyko sumažinti nuotraukos failo (%filepath%)',
    'Failed to resize image file to high resolution (%filepath%)' => 'Nepavyko pakeisti paveiksliuko išmatavimų iki aukštos rezoliucijos (%filepath%)',
    'Original image is corrupt (%filename%) for product ID %id% or bad permission on folder.' => 'Prekės ID %id% originalus paveiksliukas yra sugadintas (%filename%) arba blogi leidimai folderyje.',
    'Original image is missing or empty (%filename%) for product ID %id%' => 'Prekės ID %id% originalus paveiksliukas yra nerastas arba tuščia (%filename%)',
    'Cannot write images for this type: %1$s. Please check the %2$s folder\'s writing permissions.' => 'Nepavyko įrašyti nuotraukų pagal šį tipą: %1$s. Patikrinkite ar yra suteiktos įrašymo teisės %2$s katalogui.',
    'Only part of the images have been regenerated. The server timed out before finishing.' => 'Tik dalis paveiksliukų buvo sugeneruota iš naujo. Baigėsi užduoties vykdymo laikas serveryje.',
    'Server timed out. The watermark may not have been applied to all images.' => 'Serverio laukimo laikas baigėsi, vandenženklis nėra pritaikytas visiems vaizdams.',
    'Cannot write "No picture" image to %s images folder. Please check the folder\'s writing permissions.' => 'Negalyma rašyti "No picture" paveiksliuko į %s paveiksliukų katalogą. Patikrinkite katalogo rašymo teises.',
    'Error: Your server configuration is not compatible with the new image system. No images were moved.' => 'Klaida: jūsų serverio konfigūracija nesuderinama su naująja paveiksliukų saugojimo sistema. Paveiksliukai nebuvo perkelti.',
    'Not all images have been moved. The server timed out before finishing. Click on "Move images" again to resume the moving process.' => 'Ne visi paveiksliukai buvo perkelti. Užduoties vykdymo laikas serveryje baigėsi. Norėdami pratęsti perkėlimo procesą, paspauskite "Perkelti paveiksliukus" iš naujo.',
    'Error: Some -- or all -- images cannot be moved.' => 'Klaida: vienas – ar – daugiau paveiksliukų negali būti perkelti.',
    'After modification, do not forget to regenerate thumbnails' => 'Po pakeitimų nepamiškite iš naujo sukurti miniatiūrų',
    'The uploaded file is too large.' => 'Įkeltas failas per didelis.',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'Regenerate thumbnails\' button.' => 'Jūsų tema buvo tinkamai atstatyta pagal numatytuosius nustatymus. Galbūt norėsite atkurti savo vaizdus. Eikite "Tobulinti"> "Dizainas"> "Vaizdų nustatymai" r spauskite mygtuką "Atkurti miniatiūras".',
    'Invalid file format.' => 'Neteisingas failo formatas.',
    'Failed to move uploaded file.' => 'Neįmanoma perkelti įkeltų failų.',
    'Warning: if no email logo is available, the main logo will be used instead.' => 'Įspėjimas: neradus/nenurodžius el. laiškui skirto logotipo bus naudojamas pagrindinis logotipas.',
    'No items found' => 'Nieko nerasta',
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Jūs galite toliau naudoti savo ankstesniąją sitemą. Tai neturės jokios įtakos.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'Taip pat jūs galite nuspręsti perkelti paveiksliukus į naują saugojimo sistemą. Tokiu atveju, paspauskite ant "Perkelti paveiksliukus" mygtuko esančio žemiau. Būkite kantrūs. Tai gali užimti keletą minučių.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Geriausiam našumo rezultatui pasiekti, po paveiksliukų perkėlimo nuostatą "Naudoti senąją paveiksliukų sistemą" nustatytikite į būseną "Ne".',
    'Your page will be saved as a draft' => 'Jūsų puslapis bus išsaugotas kaip juodraštis',
    'If you want to order/move the following data, please select a shop from the shop list.' => 'Jei norite rikiuoti/perkelti šiuos duomenis, pasirinkite parduotuvę iš parduotuvių sąrašo.',
  ),
