    'Your online store needs to have a proper carrier registered in PrestaShop as soon as you start shipping your products. This means sending yours parcels using your local postal service, or having a contract with a private carrier which in turn will ship your parcels to your customers. In order to have PrestaShop suggest the most adequate carrier to your customers during their order checkout process, you need to register all the carriers with which you have chosen to work.' => 'Jūsų el. parduotuvė privalo turėti teisingą užregistruotą kurjerį PrestaShop sistemoje, kai jūs pradedate siųsti prekes pirkėjams. Tai reiškia siuntimą per vietinį pašto servisą arba kontraktą su privačiu kurjeriu, kuris pats pristatys prekes jūsų klientams. Tam, kad PrestaShop sistema galėtų pasiūlyti labiausiai tinkančius kurjerius Jūsų klientams pirkimo procese, Jums reikia įvesti visus kurjerius, su kuriais jūs pasirinkote dirbti.',
