    '%s - All persons without a customer account or customers that are not logged in.' => '%s - Visi lankytojai be kliento paskyros arba klientai, kurie yra neprisijungę.',
    '%s - All persons who placed an order through Guest Checkout.' => '%s - Visi lankytojai, kurie pateikė užsakymą neturėdami paskyros (kaip svečiai).',
    '%s - All persons who created an account on this site.' => '%s - Visi lankytojai, kurie susikūrė paskyrą šiame puslapyje.',
    'PrestaShop has three default customer groups:' => 'PrestaShop turi tris numatytąsias klientų grupes:',
    'Whether or not to display this store.' => 'Rodyti ar nerodyti šią parduotuvę.',
    'Storefront picture.' => 'Parduotuvės paveiksliukas.',
    'Displayed in emails sent to customers.' => 'Rodoma el. pašto laiškuose, siunčiamuose klientams.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Parduotuvės registracijos informacija (pvz. SIRET arba RCS).',
    'Order status (e.g. \'Pending\').' => 'Užsakymo būsena (pvz. "Laukiama").',
    'Invalid characters: numbers and' => 'Draudžiami simboliai: skaičiai ir',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Įkelkite piktogramą iš savo kompiuterio (bylos tipas: .gif, siūlomas dydis: 16x16).',
    'Status will be highlighted in this color. HTML colors only.' => 'Būsena bus paryškinta šia spalva. Tik HTML spalvos.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Leidžiamos tik raidės, skaičiai ir pabraukimo ženklas ("_").',
    'Email template for both .html and .txt.' => 'El. laiško šablonas .html ir .txt versijoms.',
    'Order\'s return status name.' => 'Užsakymo grąžinimo būsenos pavadinimas.',
    'When active, all shopping features will be disabled.' => 'Kai aktyvu, visos apsipirkimo galimybės bus išjungtos.',
    'Set the maximum size of the summary of your product description (in characters).' => 'Nurodykite didžiausią prekės trumpo aprašymo dydį (simboliais).',
    'characters' => 'simbolių(-iai)',
    'How to calculate quantity discounts.' => 'Kaip skaičiuoti kiekio nuolaidas.',
    'When active, friendly URL will be updated on every save.' => 'Kai aktyvuota, draugiškas URL bus atnaujintas kiekvieną kartą paspaudus "Išsaugoti".',
    'When active, new products will be activated by default during creation.' => 'Jei aktyvu, pagal nutylėjimą naujos prekės bus aktyvuojamas sukūrimo metu.',
    'Number of products displayed per page. Default is 10.' => 'Kiek prekių rodoma puslapyje. Numatytoji reikšmė yra 10.',
    'The order in which products are displayed in the product list.' => 'Numatytasis rikiavimas prekių sąrašui.',
    'Default order method for product list.' => 'Numatytas prekių rikiavimo būdas prekių sąrašui.',
    'Set to "0" to disable this feature.' => 'Nustatykite 0 jei norite išjungti šią funkciją.',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Rodyti ar slėpti mygtuką "į krepšelį" kategorijų puslapiuose prekėms, kurios turi atributų, kad vartotojai priverstinai peržiūrėtų prekės detales.',
    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Nuolaidų pagal kiekį lentelėje, rodyti galutinę kainą pritaikius nuolaidą vietoj pačios nuolaidos (pvz. -5%).',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Pagal numatymą, "Įdėti į krepšelį" mygtukas yra paslėptas, kai prekė yra neaktyvi (nėra sandėlyje ir kitais atvejais). Galima pasirinkti, kad jį rodytų visada.',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Kai parduodamos prekių pakuotės, kaip norite, kad būtų apskaičiuojamos atsargos?',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Pirkėjui prisijungus jūs galite parodyti paskutinio jo pirkto krepšelio turinį.',
    'Send an email with summary of the account information (email, password) after registration.' => 'Po registracijos nusiųsti el. laišką su paskyros informaciją (el. paštas, slaptažodis).',
    'Minimum time required between two requests for a password reset.' => 'Trumpiausias laiko intervalas tarp bandymų atstatyti slaptažodį.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Įjungti arba išjungti B2B režimą. Kai įjungtas šis režimas, yra pasiekiamos kai kurios B2B galimybės.',
    'Display or not the birth date field.' => 'Rodyti ar nerodyti gimimo dienos lauką.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Rodyti ar nerodyti langelį, kuriame galima pasirinkti, ar gauti pasiūlymus iš parduotuvės partnerių.',
    'Leave blank if no change.' => 'Palikit tuščią, jei nekeičiate.',
    'Fee given for each visit.' => 'Duodama nemokamai už kiekvieną apsilankymą.',
    'Fee given for each order placed.' => 'Duomada nemokamai už kiekvieną užsakymą.',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Jei žinote, kaip naudoti įprastas MySQL išraiškas, galite naudoti [1]eksperto režimą[/1].',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for customer account identification and order processing.' => 'Jei jūs turite SSL sertifikatą savo parduotuvės svetainės adresui, galite aktyvuoti SSL užšifravimą (https://) kliento paskyros tapatumo nustatymui ir užsakymų apdorojimui.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'Jei jūs norite įjungti SSL ant visų parduotuvės puslapių, aktyvuokite  "Įjungti ant visų puslapių" pasirinkimą žemiau.',
    'When enabled, all the pages of your shop will be SSL-secured.' => 'Jei įjungta, visi jūsų parduotuvės puslapiai bus apsaugoti SSL.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Įjungti arba išjungti prieigos raktą prie parduotuvės (saugumo pagerinimui)',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Leisti iframes naudoti tekstiniuose laukuose, pvz. prekės aprašyme. Rekomenduojame išjungti šį nustatymą.',
    'Clean the HTML content on text fields. We recommend that you leave this option enabled.' => 'Išvalo HTML turinį nuo nesaugių elementų tekstiniuose laukuose. Rekomenduojame palikti šią funkciją įjungtą.',
    'You can choose among 6 different ways of rounding prices. "Round up away from zero ..." is the recommended behavior.' => 'Jūs galite pasirinkti, kaip apvalinti skaičius. Visada į viršų, visada į apačią arba įprastinis apvalinimas (> .5 į viršų, < .5 į apačią).',
    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Galite pasirinkti, kada suapvalinti kainas: ar kiekvienam elementui, ar kiekvienai eilutei, ar viskam (pvz.: sąskaitai faktūrai).',
    'Choose how many decimals you want to display' => 'Pasirinkite, kiek dešimtainių norite atvaizduoti',
    'Enable brands and suppliers pages on your front office even when their respective modules are disabled.' => 'Įjungti prekių ženklų ir tiekėjų puslapius parduotuvėje, net jei jų moduliai yra išjungti.',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Įjungti perkamiausių prekių puslapius parduotuvėje, net jei jų moduliai yra išjungti.',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => 'Daugelio parduotuvių režimas leidžia jums valdyti kelias elektronines parduotuves naudojant vieną administracinę dalį. Jei ši savybė įjungta, jūs matysite "Multistore" puslapį "Išplėstinių parametrų" meniu.',
    'Contact name (e.g. Customer Support).' => 'Kontakto pavadinimas (pvz. Klientų pagalba).',
    'Emails will be sent to this address.' => 'El. laiškai bus siunčiami šiuo adresu.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Jei įjungta, tai visos žinutės bus išsaugotos "Klientų aptarnavimo" puslapyje esančiame "Klientų" meniu.',
    'Further information regarding this contact.' => 'Papildoma informacija apie šį kontaktą.',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Įjungti automatinį prekių indeksavimą. Jei jūs įjungsite šią funkciją, prekės bus suindeksuojamos iš karto, kai tik jos bus išsaugomos. Jei ši savybė išjungta, jūs turėsite patys rankiniu  būdu suindeksuoti prekes naudodamiesi nuorodomis, pateiktomis laukų sąraše.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'Pagal nutylėjimą, ieškant "blouse", turite įvesti "blous", "blo" ir t.t. (žodžio pradžią) - bet ne "lous" (žodžio vidų).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Jei ši funkcija įjungta, ji ras rezultatus, jei ieškosite "lous", "ouse" ar ką nors, esantį žodyje.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Įjungti paiešką visame žodyje, o ne tik nuo žodžio pradžios.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Jis patikrina, ar ieškomas žodis yra įtrauktas į indeksuotus žodžius. Tai gali naudoti išteklius.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Pagal nutylėjimą,  jei ieškosite "book", rasite "book", "bookcase" ir "bookend".',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Jei ši funkcija įjungta, rasite vienintelį rezultatą "book", kaip vienintelį nuo pražios iki galo atitinkantį žodį.',
    'Enable more precise search with the end of the word.' => 'Įjungia tikslesnę paiešką pagal žodžio pabaigą.',
    'It checks if the searched term is the exact end of the indexed word.' => 'Tikrinama, ar ieškotas terminas yra tiksli indeksuoto žodžio pabaiga.',
    'Only words this size or larger will be indexed.' => 'Bus indeksuojami tik ilgesni žodžiai.',
    'Please enter the index words separated by a "|".' => 'Įveskite žodžius, atskirdami juos "|".',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Įveskite sinonimus atskirdami kableliais \',\' (pvz., \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Draudžiami simboliai: <>;=#{}',
    'Search this word instead.' => 'Ieškoti šio žodžio.',
    'This field does not refer to the shop name visible in the front office.' => 'Šis laukas nėra susijęs su parduotuvės pavadinimu, rodomu parduotuvėje.',
    'Follow %sthis link%s to edit the shop name used on the front office.' => 'Spauskite ant %sšios nuorodos%s norėdami pakeisti parduotuvės pavadinimą, matomą klientams.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Negalite redaguoti parduotuvės grupės nes dabartinė parduotuvė priklauso grupei su įjungta \\"dalinimosi\\" opcija.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, %splease click here%s.' => 'Tai yra šakninė kategorija jūsų parduotuvėje. Jei norite nurodyti naują šakninę kategoriją savo parduotuvėje, %spauskite čia%s.',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Pasirinkdami susijusias kategorijas, jūs pasirenkate dalintis kategorijas tarp parduotuvių. Taip tarp parduotuvių susiejus kategoriją, visi šios kategorijos pakeitimai paveiks visas parduotuves.',
    'e.g. 10:00AM - 9:30PM' => 'pvz., 10:00 - 21:30',
    'Show me more' => 'Rodyti daugiau',
    'Definitions:' => 'Sąvokos:',
    'The "http_referer" field is the website from which your customers arrive.' => 'Laukas "http_referer" yra svetainė, iš kurios jūsų atkeliavo jūsų lankytojai.',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'Pavyzdžiui, lankytojai, ateinantys iš Google svetainės, turės "http_referer" lauko reikšmę tokią: "http://www.google.com/search?q=prestashop".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'Jei vartotojas ateina tiesiogiai (pvz., įvesdamas adresą naršyklės lange), tai laukas \'http_referer\' bus tuščias.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Taigi, jei norite visų lankytojų iš Google, įrašykite laukelyje \\"%google%\\" arba \\"%google.lt%\\" jei norite tik Google.lt lankytojų.',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'Laukas \'request_uri\' yra URL, iš kurio jūsų lankytojai ateina į jūsų svetainę.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'Pavyzdžiui, jei lankytojas įeina į prekės puslapį, tai URL bus toks: "%smusic-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Tai yra naudinga, nes galite pridėti žymas arba raktus į nuorodas, kurios veda į jūsų interneto svetainę.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'Pavyzdžiui, jūs galite palikti nuorodą (tokią kaip "%sindex.php?myuniquekeyword" - atkreipkite dėmesį į pridėtą "?myuniquekeyword" URL gale) forume arba tinklaraščio komentaruose, tokiu būdų gaunant lankytojų statistiką iš tos unikalios nuorodos - įvedant "%%myuniquekeyword" į "request_uri" (užklausos_uri) lauką.',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'Šis metodas yra labiau patikimas nei "http_referer" metodas, bet yra vienas trūkumas: jei paieškos variklis aptiks jūsų nuorodą, ji bus rodoma paieškos rezultatuose ir jūs gausite lankytojų srautą ir paieškos rezultatų, bet ne iš to puslapio, kuriame palikote nuorodą.',
    'The "Include" fields indicate what has to be included in the URL.' => 'Laukai "įtraukti" (angl. "include") nurodo, kas turi būti įtraukta į URL.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'Laukas "Exclude" nurodo, ką reikia šalinti iš URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Naudojant supaprastintą režimą, galite naudoti specifinius ženklus, kurie gali pakeisti kitus simbolius:',
    '_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '_" pakeis vieną simbolį. Jei norite naudoti "_" kaip simbolį, jį įveskite taip: "\\\\_".',
    '%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" pakeis bet kiek simbolių. Jei norite naudoti "%" kaip simbolį, jį įveskite taip: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'Supaprastintas rėžimas naudoja MySQL "LIKE" komanda tekstų lyginimui, tačiau eksperto rėžime jūs galite naudoti galingesnes RegEx komandas.',
    'Take a look at MySQL\'s documentation for more details.' => 'Žiūrėkite MySQL doukmentaciją dėl daugiau informacijos.',
    'Get help!' => 'Gaukite pagalbą!',
    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'Tai yra labai didelis duomenų kiekis, kadangi kiekvieno prisijungimo referer yra išsaugomas. Jūs taip pat galite atnaujinti šį indeksą paspaudę aukščiau esantį mygtuką. Procesas gali užtrukti kurį laiką ir jis reikalingas tik jeigu jūs pakeitėte ar pridėjote "referer", arba jūs norite kad pakeitimai būtų "retroactive".',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Jūsų duomenys yra kešuojami tam, kad juos būtų galima rikiuoti ir filtruoti. Jūs galite atnaujinti spartinančiąją atmintį paspausdami "Atnaujinti spartinančiąją atmintį" mygtuką.',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Tiesioginis srautas gali būti imlus resursams. Jūs turėtumėte jį įjungti tik jei jums tikrai to reikia.',
  ),
  'AdminShopparametersNotification' => 
  array (
    'Before you can use this tool, you need to:' => 'Prieš naudojant šį įrankį, jums reikia:',
    '1) Create a blank .htaccess file in your root directory.' => '1) Sukurti tuščią .htaccess failą pradiniame svetainės aplanke.',
    '2) Give it write permissions (CHMOD 666 on Unix system).' => '2) Suteikti rašymo teises (CHMOD 666 and Unix sistemų).',
    'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).' => 'Jūsų robots.txt failas TURI BŪTI jūsų svetainės pradiniame aplanke ir niekur kitur (pvz. http://www.example.com/robots.txt).',
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Sukurti "robots.txt" failą paspaudžiant šį mygtuką (jis ištrins seną robots.txt failą)',
    '1) Create a blank robots.txt file in your root directory.' => '1) Sukurkite tuščią robots.txt failą pradiniame aplanke.',
    'Here you can set the URL for your shop. If you migrate your shop to a new URL, remember to change the values below.' => 'Čia jūs galite nustatyti savo parduotuvės URL. Jei perkelsite parduotuvę į naują URL, nepamirškite pakeisti šias reikšmes.',
    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'Įjungtas daugelio parduotuvių režimas. Jei norite pakeisti savo parduotuvės URL, privalote nueiti į "Daugelio parduotuvių" puslapį puslapyje "Išplėstinės parinktys"',
    'This section enables you to change the default pattern of your links. In order to use this functionality, PrestaShop\'s "Friendly URL" option must be enabled, and Apache\'s URL rewriting module (mod_rewrite) must be activated on your web server.' => 'Ši dalis suteikia Jums galimybę pakeisti numatytąją nuorodų struktūrą. Jei norite tai panaudoti, turi būti įjungta: "Draugiškas URL" PrestaShop nustatymas ir Apache URL perrašymo modulis (mod_rewrite) Jūsų serveryje.',
    'There are several available keywords for each route listed below; note that keywords with * are required!' => 'Yra keli galimi raktiniai žodžiai kiekvienai nuorodai - jie nurodyti žemiau. Raktiniai žodžiai, pažymėti *, yra privalomi!',
    'To add a keyword in your URL, use the {keyword} syntax. If the keyword is not empty, you can add text before or after the keyword with syntax {prepend:keyword:append}. For example {-hey-:meta_title} will add "-hey-my-title" in the URL if the meta title is set.' => 'Jei norite pridėti raktinį žodį į URL, naudokite {keyword} sintaksę. Jei raktažodis nėra tuščias, Jūs galite pridėti tekstą prieš ar po raktinio žodžio su sintakse {prepend:keyword:append}. Pavyzdžiui, {-hey-:meta_title} sugeneruos "-hey-my-title", jei meta pavadinimas yra nurodytas.',
    'You can only display the page list in a shop context.' => 'Jūs galite rodyti puslapių sąrašą tik parduotuvės kontekste.',
    'Before being able to use this tool, you need to:' => 'Prieš naudojant šį įrankį, jums reikia:',
    'Create a blank .htaccess in your root directory.' => 'Sukurti tuščią .htaccess failą šakniniame kataloge.',
    'Give it write permissions (CHMOD 666 on Unix system).' => 'Suteikti rašymo leidimą (CHMOD 666 Unix sistemoje).',
    'Assign a valid page if you want it to be read.' => 'Priskirkite veikiantį puslapį, jei norite, kad jis būtų skaitomas.',
    'You must define an SMTP server and an SMTP port. If you do not know it, use the PHP mail() function instead.' => 'Privalote nurodyti SMTP serverį ir SMTP prievadą. Jei jo nežinote, naudokite PHP mail() funkciją.',
    'The discount value is incorrect (must be a percentage).' => 'Nuolaidos reikšmė neteisinga (turi būti procentai).',
    'Wrong category ID.' => 'Blogas kategorijos ID.',
    'The discount value is incorrect.' => 'Neteisinga nuolaidos reikšmė.',
    'You cannot save group reductions.' => 'Negalima išsaugoti grupės nuolaidų.',
    'An error occurred while updating this group.' => 'Įvyko klaida atnaujinant grupę',
    'An address located in a country containing states must have a state selected.' => 'Adresas su šalimi turinčia valstiją turi turėti pasirinktą valstiją.',
    'Latitude and longitude are required.' => 'Ilguma ir platuma yra privalomos.',
    'The specified state is not located in this country.' => 'Nurodyta valstija nėra šioje šalyje.',
    'For security reasons, you cannot delete default order statuses.' => 'Saugumo sumetimais jūs negalite ištrinti numatytas užsakymo būsenas.',
    'Please install the "%modulename%" module in order to give your affiliates access to their own statistics.' => 'Įdiekite modulį "%modulename%", jei norite suteikti savo partneriams priėjimą prie jų statistikos.',
    'Percent of the sales.' => 'Procentas nuo pardavimų.',
